      </div>
      <div className="box-list-tags">
        Свободные места:{" "}
        {tags.map((tag) => (
          <p className="box-tags" key={tag}>
            {tag}
          </p>
        ))}
      </div>
      <div className="box-places">
        <div className="place-item">
          <h1>10:41</h1>
          <p>17.10.2023</p>
          <p>Ростов-на-Дону</p>
        </div>
      </div>
    </div>
  );
};

export default TrainCard;
